/*Table structure for table `commodity` */

CREATE TABLE `commodity` (
  `name` varchar(100) NOT NULL COMMENT '名称',
  `price` double NOT NULL COMMENT '价格',
  `seller` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '卖家',
  `id` int NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `introduction` varchar(100) NOT NULL COMMENT '卖家说明',
  `time` datetime NOT NULL COMMENT '上架时间',
  `contact` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '联系方式',
  `picture1` mediumblob NOT NULL COMMENT '图片1',
  `picture2` mediumblob NOT NULL COMMENT '图片2',
  `picture3` mediumblob NOT NULL COMMENT '图片3',
  `status` varchar(10) NOT NULL COMMENT '商品状态',
  `sign` tinyint(1) NOT NULL DEFAULT '0' COMMENT '标记',
  PRIMARY KEY (`id`),
  KEY `name` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=25 DEFAULT CHARSET=utf8mb3;

