/*Table structure for table `complaint` */

CREATE TABLE `complaint` (
  `id` int NOT NULL COMMENT '被投诉的商品id',
  `content` varchar(100) NOT NULL COMMENT '投诉的内容',
  `name` varchar(30) NOT NULL COMMENT '被投诉的商品名称',
  `number` int NOT NULL AUTO_INCREMENT COMMENT '投诉编号',
  `sign` tinyint(1) NOT NULL DEFAULT '0' COMMENT '标记',
  PRIMARY KEY (`number`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8mb3;

