CREATE TABLE `favorite` (
  `phone` varchar(30) NOT NULL COMMENT '收藏的人的手机号',
  `id` int NOT NULL COMMENT '收藏的商品id',
  `sign` tinyint(1) NOT NULL DEFAULT '0' COMMENT '标记'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3;

