  `phone` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '私信的接收方的电话',
  `content` varchar(100) NOT NULL COMMENT '内容',
  `is_read` tinyint(1) NOT NULL COMMENT '是否已读',
  `number` int NOT NULL AUTO_INCREMENT COMMENT '私信编号',
  PRIMARY KEY (`number`)
) ENGINE=InnoDB AUTO_INCREMENT=29 DEFAULT CHARSET=utf8mb3;

