/*Table structure for table `user` */

CREATE TABLE `user` (
  `phone` varchar(30) NOT NULL COMMENT '电话',
  `password` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '密码',
  `consumption` int NOT NULL COMMENT '消费',
  `income` double NOT NULL COMMENT '收入',
  `integrity` double NOT NULL COMMENT '诚信积分',
  `name` varchar(30) NOT NULL COMMENT '用户名',
  `ban_time` date DEFAULT NULL COMMENT '封禁时间',
  `ban_number` int NOT NULL DEFAULT '0' COMMENT '封禁次数',
  `sign` tinyint(1) NOT NULL DEFAULT '0' COMMENT '标记',
  PRIMARY KEY (`phone`),
  KEY `phone` (`phone`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3;

